const Prescription_Ready = 0;
const Prescription_Verified_Patient = 1;
const Prescription_Verified_Pharmacist = 2;
const Prescription_Pending_Insurance = 3;
const Prescription_Processed = 4;

const Prescription_Pending_Patient = 5;
const Prescription_Pending_Physician = 6;

export const PrescriptionStatus = {
    Ready: Prescription_Ready,
    Verified_Patient: Prescription_Verified_Patient,
    Verified_Physician: Prescription_Verified_Pharmacist,
    Pending_Insurance: Prescription_Pending_Insurance,
    Processed: Prescription_Processed,
    Pending_Physician: Prescription_Pending_Patient,
    Pending_Patient: Prescription_Pending_Physician,

    GetTranslation: (type) => {
        switch (type) {
            case Ready: return "Ready";
            case Verified_Patient: return "Verify Physician";
            case Verified_Physician: return "Send to Insurance";
            case Pending_Insurance: return "Waiting on Insurance System";
            case Processed: return "Processed";
            case Pending_Physician: return "Waiting on Valid Physician";
            case Pending_Patient: return "Waiting on Valid Patient";
        }
    }
};
